import './App.css';
import Posts from "./Posts";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SettingsPage from './SettingsPage';
import ContactPage from './ContactPage';
import {Avatar} from "@mui/material";
import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from "./Sidebar";

function App() {
    let profile_pic = "https://www.pluggedin.com/wp-content/uploads/2023/03/a-good-person.jpg";
    return (
        <Router>
            <div className="App">
                <header className="App-header">
                    <nav className="nav nav-pills nav-fill bg-dark border-bottom fixed-top bg-body-tertiary" data-bs-theme="dark">
                        <Link to="/" className="nav-link">Home</Link>
                        <Link to="/settings" className="nav-link">Settings</Link>
                        <Link to="/contact" className="nav-link">Contact</Link>
                        <Link to="/contact" className="nav-link">Contact</Link>
                    </nav>
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/settings" element={<SettingsPage />} />
                        <Route path="/contact" element={<ContactPage />} />
                    </Routes>
                </header>
            </div>
        </Router>
    );
}

// Home component for the '/' route
function Home() {
    return (
        <div className="container">
            {/* Navbar */}
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container">
                    <a className="navbar-brand" href="/">Coding Challenges</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ms-auto">
                            <li className="nav-item">
                                <a className="nav-link" href="/challenges">Challenges</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="/discussions">Discussions</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="/profile">Profile</a>
                            </li>
                            <li className="nav-item">
                                <a className="btn btn-primary" href="#">Sign Up / Log In</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

            {/* Main Content */}
            <div className="container mt-4">
                <h1>Welcome to Coding Challenges</h1>
                <p>Take on coding challenges, collaborate with peers, and level up your coding skills!</p>
                {/* Add more content here */}
            </div>
        </div>
    );
}

export default App;
